var now = new Date();
var jsDate = now.getDate()+'-'+(now.getMonth()+1)+'-'+now.getFullYear();
//Datatable with button function
function plaindatatable_btn(tbl_name, data_list, tbl_columns, hidden_col) {
	if ($.fn.DataTable.isDataTable('#'+tbl_name)) {
		$('#'+tbl_name).DataTable().destroy();
	} 
	if (hidden_col.length != undefined) {
		hidden_col_colvis = hidden_col.length -1;
	} else {
		hidden_col_colvis = hidden_col
	}
	var table = $("#"+tbl_name);
	table.dataTable({
		autoWidth: false,
		columns: tbl_columns,
		data: data_list,
		"bDestroy": true,
		language: {
			aria: {
				sortAscending: ": activate to sort column ascending",
				sortDescending: ": activate to sort column descending"
			},
			emptyTable: "No data available",
			info: "Showing _START_ to _END_ of _TOTAL_ entries",
			infoEmpty: "No entries found",
			infoFiltered: "(filtered1 from _MAX_ total entries)",
			lengthMenu: "_MENU_ entries",
			search: "",
			zeroRecords: "No matching records found"
		},
		buttons: [{
			extend: 'collection',
			className: "exporticon",
			text: 'Export',
			buttons: [{
				extend: "pdf",
				className: "pdficon",
				exportOptions: {
					columns: ':visible'
				},
				customize: function (doc) { pageNumberPDF(doc) }
			}, {
				extend: "excel",
				className: "excelicon",
				exportOptions: {
					columns: ':visible'
				},
				customize: function(xlsx) { pageHeaderExcel(xlsx,table.fnGetData().length) }
			}, {
				extend: "csv",
				className: "csvicon",
				exportOptions: {
					columns: ':visible'
				},
				customize: function (csv) {
					return "My header NEXT Inc.\n\n NEXT Inc.\n"+  csv;
				}
			}],
		},{
			extend: "print",
			className: "printicon",
			exportOptions: {
				columns: ':visible'
			},
			message: '<p style="text-align:center;"><img src="data:image/png;base64,"></p><p style="text-align:center;">Date : '+jsDate.toString()+' </p>',
			customize: function (win) {
				$body = $(win.document.body);
				$body.find('h1').css('text-align', 'center');
			}
		}, {
			extend: "copy",
			className: "copyicon",
			exportOptions: {
				columns: ':visible'
			}
		},  {
			extend: "colvis",
			className: "colvisicon",
			text: "Columns",
			columns: ':gt('+hidden_col_colvis+')'
		}],
		columnDefs: [{ "visible": false, "targets": hidden_col }],
		responsive: !0,
		order: [[0, "asc"]],
		lengthMenu: [[5, 10, 15, 20, -1], [5, 10, 15, 20, "All"]],
		pageLength: 5,
		//dom: "<'row' <'col-md-12'B>><'row'<'col-md-6 col-sm-12'l><'col-md-6 col-sm-12'f>r><'table-scrollable't><'row'<'col-md-5 col-sm-12'i><'col-md-7 col-sm-12'p>>"
		dom: "<'row' <'col-md-12'B>><'row'<'col-md-6 col-sm-12'><'col-md-6 col-sm-12'f>r><'table-scrollable't><'row'<'col-md-6 col-sm-12'i><'col-md-6 col-sm-12'lp>>",
	});

	if (!table.fnGetData().length) {
		$("#"+tbl_name).dataTable().fnDestroy();
		$("#"+tbl_name).DataTable( {
			autoWidth: false,
			columns: tbl_columns,
			searching: false,
			lengthChange: false,
			language: {
				emptyTable: "No data available"
			},
			columnDefs: [{ "visible": false, "targets": hidden_col }],
		});
	}
}

//Excel export with headers
function  pageHeaderExcel(xlsx,tbl_len) {
	var sheet = xlsx.xl.worksheets['sheet1.xml'];
	console.log(sheet);   
	var downrows = 4;
	var clRow = $('row', sheet);
	var msg;
	//update Row
	clRow.each(function() {
		var attr = $(this).attr('r');
		var ind = parseInt(attr);
		ind = ind + downrows;
		$(this).attr("r", ind);
	});

	// Update  row > c
	$('row c ', sheet).each(function() {
		var attr = $(this).attr('r');
		var pre = attr.substring(0, 1);
		var ind = parseInt(attr.substring(1, attr.length));
		ind = ind + downrows;
		$(this).attr("r", pre + ind);
	});
	function Addrow(index, data) {
		msg = '<row r="' + index + '">';
		for (var i = 0; i < data.length; i++) {
			var key = data[i].k;
			var value = data[i].v;
			msg += '<c t="inlineStr" s="2"  r="' + key + index + '">';
			msg += '<is>';
			msg += '<t>' + value + '</t>';
			msg += '</is>';
			msg += '</c>';
		}
		msg += '</row>';
		return msg;
	}

	var r1 = Addrow(1, [{
		k: 'A',
		v: 'Export Date :'
	}, {
		k: 'B',
		v: jsDate.toString()
	}]);
	var r2 = Addrow(2, [{
		k: 'A',
		v: 'Company :'
	}, {
		k: 'B',
		v: 'NEXT Inc.'
	}]);
	var r3 = Addrow(3, [{
		k: 'A',
		v: 'Location :'
	}, {
		k: 'B',
		v: 'Coimbatore'
	}]);
	var r4 = Addrow(tbl_len+7,[{
		k: 'B',
		v: 'Total Number of Records'
	},{
		k: 'C',
		v: tbl_len
	}])
	sheet.childNodes[0].childNodes[1].innerHTML = r1 + r2 + r3 + sheet.childNodes[0].childNodes[1].innerHTML +r4;
	// Loop over the cells in column `C`
	$('row c[r^="D"]', sheet).each( function () {
		// Get the value
		if ( $('is t', this).text() == 'cms@png.com' ) {
			$(this).attr( 's', '20' );
		}
	});
	var col = $('col', sheet);
	col.each(function () {
		$(this).attr('width', 15);
	});      
	$(col[0]).attr('width', 15);  
	$(col[1]).attr('width', 50);              
}

//PDF export with page number add
function pageNumberPDF(doc){
	doc.content.splice(0,1);
	doc.pageMargins = [20,60,20,30];
	//Create a date string that we use in the footer. Format is dd-mm-yyyy
	var header_logo = 'data:image/*;base64,';
	var logo = 'data:image/png;base64,';
	doc['header']=(function() {
		return {
			columns: [{
				alignment: 'left',
				image: header_logo,
				width:100,
				height:50,
				margin: [20, 0, 0, 0]
			},
			{
				alignment: 'right',
				fontSize: 12,
				text: ['Created by: ', { text : 'NEXT Inc.' }],
				margin: [0, 10, 20, 0]
			}
			],
		}
	});
	// Create a footer object with 2 columns
	// Left side: report creation date
	// Right side: current page and total pages
	doc['footer']=(function(page, pages) {
		return {
			columns: [{
				alignment: 'left',
				text: ['Created on: ', { text: jsDate.toString() }],
				margin: [ 10, 30, 0, 10 ],
			},
			{
				alignment: 'right',
				image: logo,
				width:69,
				height:60
			}],
			margin: [ 0, -30, 0, 0 ]
		}
	});
	// Change dataTable layout (Table styling)
	// To use predefined layouts uncomment the line below and comment the custom lines below
	//doc.content[0].layout = 'lightHorizontalLines'; // noBorders , headerLineOnly
	var objLayout = {};
	objLayout['hLineWidth'] = function(i) { return .5; };
	objLayout['vLineWidth'] = function(i) { return .5; };
	objLayout['hLineColor'] = function(i) { return '#aaa'; };
	objLayout['vLineColor'] = function(i) { return '#aaa'; };
	objLayout['paddingLeft'] = function(i) { return 4; };
	objLayout['paddingRight'] = function(i) { return 4; };
	doc.content[0].layout = objLayout;
}

