//Editable data table function
function editable_datatable(tbl_name, data_list, tbl_plus_id, titles) {

	// Editable Table load
	var table = $("#"+tbl_name);

	var oTable = table.dataTable({
		// Uncomment below line("dom" parameter) to fix the dropdown overflow issue in the datatable cells. The default datatable layout
		// setup uses scrollable div(table-scrollable) with overflow:auto to enable vertical scroll(see: assets/global/plugins/datatables/plugins/bootstrap/dataTables.bootstrap.js).
		// So when dropdowns used the scrollable div should be removed.
		//"dom": "<'row'<'col-md-6 col-sm-12'l><'col-md-6 col-sm-12'f>r>t<'row'<'col-md-5 col-sm-12'i><'col-md-7 col-sm-12'p>>",

		"lengthMenu": [[5, 15, 20, -1], [5, 15, 20, "All"] ],// change per page values here

		// Or you can use remote translation file
		//"language": {
		//   url: '//cdn.datatables.net/plug-ins/3cfcc339e89/i18n/Portuguese.json'
		//},

		// set the initial value
		"pageLength": 5,

		"language": {
			"lengthMenu": " _MENU_ records"
		},
		"columns": titles,
		"data": data_list,
		"columnDefs": [{ // set default column settings
			'orderable': true,
			'targets': [0]
		}, {
			"searchable": true,
			"targets": [0]
		}],
		"order": [[0, "asc"]] // set first column as a default sort by asc
	});

	var nEditing = null;
	var nNew = false;

	// Table add row click
	$('#'+tbl_plus_id).click(function (e) {
		e.preventDefault();
		if (nNew && nEditing) {
			if (confirm("Previose row not saved. Do you want to save it ?")) {
				saveRow(oTable, nEditing); // save
				$(nEditing).find("td:first").html("Untitled");
				nEditing = null;
				nNew = false;
			} else {
				oTable.fnDeleteRow(nEditing); // cancel
				nEditing = null;
				nNew = false;
				return;
			}
		}
		var oData = oTable.fnGetData()[0];
		var temp_list = [];
		var aiNew = oTable.fnAddData(['', '', '', '', '', '']);
		var nRow = oTable.fnGetNodes(aiNew[0]);
		editRow(oTable, nRow);
		nEdi0ting = nRow;
		nNew = true;
	});

	table.on('click', '.delete', function (e) {
		e.preventDefault();

		if (confirm("Are you sure to delete this row ?") == false) {
			return;
		}

		var nRow = $(this).parents('tr')[0];
		oTable.fnDeleteRow(nRow);
		alert("Deleted! Do not forget to do some ajax to sync with backend :)");
	});

	table.on('click', '.cancel', function (e) {
		e.preventDefault();
		if (nNew) {
			oTable.fnDeleteRow(nEditing);
			nEditing = null;
			nNew = false;
		} else {
			restoreRow(oTable, nEditing);
			nEditing = null;
		}
	});

	table.on('click', '.edit', function (e) {
		e.preventDefault();
		nNew = false;

		/* Get the row as a parent of the link that was clicked on */
		var nRow = $(this).parents('tr')[0];

		if (nEditing !== null && nEditing != nRow) {
			/* Currently editing - but not this row - restore the old before continuing to edit mode */
			restoreRow(oTable, nEditing);
			editRow(oTable, nRow);
			nEditing = nRow;
		} else if (nEditing == nRow && this.innerHTML == "Save") {
			/* Editing this row and want to save it */
			saveRow(oTable, nEditing);
			nEditing = null;
			var tableData = table.fnGetData(nRow)
			row_save(tableData);
			alert("Updated! Do not forget to do some ajax to sync with backend :)");
		} else {
			/* No edit in progress - let's start one */
			editRow(oTable, nRow);
			nEditing = nRow;
		}
	});
}

function restoreRow(oTable, nRow) {
	var aData = oTable.fnGetData(nRow);
	var jqTds = $('>td', nRow);
	for (var i = 0, iLen = jqTds.length; i < iLen; i++) {
		oTable.fnUpdate(aData[i], nRow, i, false);
	}
	oTable.fnDraw();   
}

function editRow(oTable, nRow) {
	var aData = oTable.fnGetData(nRow);
	var jqTds = $('>td', nRow);
	jqTds[0].innerHTML = '<input type="text" class="form-control input-small" value="' + aData[0] + '">';
	jqTds[1].innerHTML = '<input type="text" class="form-control input-small" value="' + aData[1] + '">';
	jqTds[2].innerHTML = '<select class="form-control" id="objective_role" name = "objective_role" placeholder="objective type"><option value="role1">role1</option><option value="role2">role2</option></select><span class="help-block">  </span> </div>';
	jqTds[3].innerHTML = '<select class="form-control" id="objective_role" name = "objective_role" placeholder="objective type"><option value="role1">role1</option><option value="role2">role2</option></select><span class="help-block">  </span> </div>';
	jqTds[4].innerHTML = '<select class="form-control" id="objective_role" name = "objective_role" placeholder="objective type"><option value="role1">role1</option><option value="role2">role2</option></select><span class="help-block">  </span> </div>';
	jqTds[5].innerHTML = '<a class="cancel" href="">Cancel</a>';
}

function saveRow(oTable, nRow) {
	var jqInputs = $('input', nRow);
	oTable.fnUpdate(jqInputs[0].value, nRow, 0, false);
	oTable.fnUpdate(jqInputs[1].value, nRow, 1, false);
	oTable.fnUpdate('<select class="form-control" id="objective_role" name = "objective_role" placeholder="objective type"><option value="role1">role1</option><option value="role2">role2</option></select><span class="help-block">  </span> </div>' , nRow, 2, false);
	oTable.fnUpdate('<a class="delete" href=""><i class="fa fa-trash-o" aria-hidden="true"></i></a>', nRow, jqInputs.length+1, false);
	oTable.fnDraw();
}

function cancelEditRow(oTable, nRow) {
	var jqInputs = $('input', nRow);
	oTable.fnUpdate(jqInputs[0].value, nRow, 0, false);
	oTable.fnUpdate(jqInputs[1].value, nRow, 1, false);
	oTable.fnUpdate(jqInputs[2].value, nRow, 2, false);
	oTable.fnUpdate(jqInputs[3].value, nRow, 3, false);
	oTable.fnUpdate(jqInputs[4].value, nRow, 4, false);
	oTable.fnUpdate(jqInputs[5].value, nRow, 5, false);
	oTable.fnUpdate('<a class="edit" href=""><i class="fa fa-pencil-square-o" aria-hidden="true"></i></a>', nRow, 6, false);
	oTable.fnDraw();
}
